Please join me at the "Wild Horse and Burro Freedom Rally" July 2nd on the south steps of the Utah State Capitol building to protest the mass roundup of the iconic Onaqui herd by the Bureau of Land Management.

We are calling on the Bureau to ensure that America’s wild horses and burros do not end up at slaughter, that their numbers are controlled humanely with fertility control, and that livestock grazing in herd management areas is limited to protect ecosystems. 

For more information on how to attend the protest visit savetheonaqui.org (link in bio) #SaveTheOnaqui #WildHorses #WildHorseFreedomRally 

